const int endpage_1[240][320];
const int endpage_2[240][320]; 
const int start[240][320]; 
const int rules_page[240][320];

int main(void)
{
    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    /* Read location of the pixel buffer from the pixel buffer controller */
    pixel_buffer_start = *pixel_ctrl_ptr;
	srand(time(NULL));
	
    clear_screen();
	
	//colours for symbols on the cards
	short int colour[10] = {0xFEB4, 0xED95,  0xCFFA, 0xB4D0, 0xFEEC, 0xFEB4, 0xED95, 0xCFFA, 0xB4D0, 0xFEEC};
	
	bool gameStart = false; //set to false after testing is done 
	bool gameEnd = false; 
	
	//display initial player scores (both scores = 0) 
	display_score(0, 0);
	display_score(1, 0);
	
	while(1){
		//code to display start page
		draw_page(start);
		
		check_SpacePressed(); //first press is to display rules page 
		check_SpacePressed(); 
		draw_page(rules_page);
		
		check_SpacePressed(); //second press is to start game
		check_SpacePressed(); 
		gameStart = true; 
		
		
		if(gameStart){ //if start button is pressed 
			shuffle_deck(colour, 10);
			int win = game_start(colour); //if win = 0 player 1 win
			
			//game over, code to display end screen 
			if(win == 0){
				draw_page(endpage_1); //if win = 0 player 1 wins
			} else{ 
				draw_page(endpage_2); //player 2 wins 
			}
			
			//wait for user to press space to restart 
			check_SpacePressed();
			check_SpacePressed(); 
			
			//reset scores on hex display 
			display_score(0, 0);
			display_score(1, 0);
			
			gameStart = false;
		}	
	}	
}

int game_start(short int *array){
	clear_screen(); 
	draw_all_cards(); //display cards
	
	volatile int *SW_PTR = 0xFF200040;
	
	int player = 0; //player 1's turn. Change to 1 when player 2's turn 
	int player1_score = 0; 
	int player2_score = 0; 
	int card1 = 0;
	int card2 = 0; //stores what cards player chooses during their turn
	int score = 0;
	int cards_available[10] = {1, 2, 4, 8, 16, 32, 64, 128, 256, 512}; //store cards that user can pick
	int temp1, temp2, index1, index2; 
	bool valid; 
	
	//display_cards(array); 
	
	while(player1_score + player2_score != 5){ //max points = 5	 
		int y1 = 56;
		int y2 = 56;
		valid = false; 
		while(!valid){ //loops until user chooses a switch for card1
			card1 = *SW_PTR;
			temp1 = card1;
			for(int i = 0; i < 10; i++){ 
				if(card1 == cards_available[i] && cards_available[i] != 0){
				 valid = true; //loop until user selects a card that is still available 
				}
			}
		}
		
		card1 = flip_card(card1, array); //flip the first card user selected
		index1 = card1; 
		if(index1 >= 5 ){ 
			y1 = 160; 
			card1 = card1 - 5; 
		}
		
		while(temp1 != 0){ //wait for user to turn switch off before proceeding
			temp1 = *SW_PTR;
		}
			
		valid = false; 
		while(!valid){ //loops until user chooses a switch for card2
			card2 = *SW_PTR; 
			temp2 = card2;
			for(int i = 0; i < 10; i++){ 
				if(card2 == cards_available[i] && cards_available[i] != 0){
				 valid = true; //loop until user selects a card that is still available 
				}
			}
		}
	
		
		card2 = flip_card(card2, array); //flip the second card user selected
		index2 = card2; 
		if(index2 >= 5 ){ 
			y2 = 160;
			card2 = card2 - 5; 
		}
		delay_loop();
		
		while(temp2 != 0){
			temp2 = *SW_PTR;
		}
		
		
		if(array[index1] == array[index2]){ //check if two cards are the same colour 
			//if the cards are the same 
			cards_available[index1] = 0; 
			cards_available[index2] = 0; //keep cards flip up, remove the two cards from available choices 
			score = 1; 
		} else{//if not the same colour, score = 0 
			draw_square_symbol(30 + 59*card1, y1, 0xFFFF); //turn cards over if wrong
			draw_square_symbol(30 + 59*card2, y2, 0xFFFF);
			//printf("Turn over cards: %d, %d\n", index1, index2);
		}
			
		if(player == 0){ //player 1's turn 
			player1_score += score;
			display_score(player, player1_score); //update score on hex display
			player = 1; //switch to player 2 turn 
		}else{ //player 2's turn
			player2_score += score;
			display_score(player, player2_score);
			player = 0; 
		}
		score = 0;
		card1 = 0; 
		card2 = 0; 
	}
	//max points reached 
	if(player1_score > player2_score){
		return 0; //player 1 won the game
	}
	return 1; 
}

void check_SpacePressed(){
	volatile int * PS2_ptr = (int *)PS2_BASE;
	int PS2_data = 0; 
	int RVALID;
	bool gameStart = false; 
	*(PS2_ptr) = 0xFF;
	while (!gameStart) {
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000;
		if (RVALID && PS2_data == 32809) { //32809 is num stored in PS2_data if space is pressed
			gameStart = true; 
			return; 
		}
	}		
}

int flip_card(int card, short int *array){
	int index; 
	if(card == 1 ){
		card = 0; 
	} else if(card == 2){
		card = 1; 
	} else if(card == 4){
		card = 2;
	} else if(card == 8){
		card = 3; 
	} else if(card == 16){
		card = 4; 
	} else if(card == 32){
		card = 5;
	} else if(card == 64){
		card = 6;
	} else if(card == 128){
		card = 7;
	} else if(card == 256){
		card = 8;
	} else if(card == 512){
		card = 9;
	}
	
	int y = 56; //flip card in bottom row
	index = card; 
	if(card >= 5 ){ 
		y = 160; 
		card = card - 5;
	} //flip card in top row 
	draw_square_symbol(30 + 59*card, y, array[index]);
	return index;
}

void shuffle_deck(short int *array, size_t n){
    if (n > 1) 
    {
        size_t i;
        for (i = 0; i < n - 1; i++) 
        {
          size_t j = i + rand() / (RAND_MAX / (n - i) + 1);
          int t = array[j];
          array[j] = array[i];
          array[i] = t;
        }
    }
}

void display_cards(short int *array){
	//shuffle_deck(array, 10);
	
	int x = 30;
	for(int i = 0; i < 5; i++){ //draw top row 
		draw_square_symbol(x, 56, array[i]);
		x += 59;
	}
	
	x = 30;
	for(int i = 5; i < 10; i++){ //draw bottom row
		draw_square_symbol(x, 160, array[i]);
		x += 59;
	}

}

void draw_card(int x1, int y1){
	for(int x = x1; x < x1 + 34; x++){
		for(int y = y1; y < y1 + 72; y++){
			plot_pixel (x, y, 0xFFFF); //make pixels white 
		}
	}	
}

void draw_all_cards(){
	//draw white cards: bottom row
    draw_card(25, 136);
	draw_card(84, 136);
	draw_card(143, 136);
	draw_card(202, 136);
	draw_card(261, 136);
	
	//draw white cards:top row
	draw_card(25, 32);
	draw_card(84, 32);
	draw_card(143, 32);
	draw_card(202, 32);
	draw_card(261, 32);
}

void draw_square_symbol(int x1, int y1, short int colour){ //draw a square on the card 
	for(int x = x1; x < x1 + 24; x++){
		for(int y = y1; y < y1 + 24; y++){
			plot_pixel (x, y, colour); //make all pixels black 
		}
	}	
}

void plot_pixel(int x, int y, short int line_color){		
    volatile short int *one_pixel_address;

    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

    *one_pixel_address = line_color;
}

void display_score(int player, int index){ //player will be 0 or 1. If 0, increment score for player 1
	int score[6] = {0b00111111, 0b00000110, 0b01011011, 0b01001111, 0b01100110, 0b01101101};
	// ^score array stores codes to display numbers 0 - 5 in the hex display 
	
	if(player == 0){ //player will be 0 or 1. If 0, increment score for player 1
		*ADDR_7SEG1 = score[index]; 
	} else{ //increment score for player 2 
		*ADDR_7SEG2 = score[index];
	}
	return; 
}

void clear_screen(){
	int y, x;
	
	for(x = 0; x < 320; x++){
		for(y = 0; y < 240; y++){
			plot_pixel (x, y, 0); //make all pixels black 
		}
	}
}

void delay_loop(){
	int i = 1500000; 
	while(i != 0){
		i--;
	}
}

void draw_page(const int array[240][320]){
    int i;
	int j;
	for(i=0; i<320;i++){
		for(j=0;j<240;j++){
			plot_pixel(i,j,array[j][i]);
		}
	}
}

